        <div className='col-lg-4'>
          <div className='card'>
            <div className='card-body'>
              <div>

              </div>
              <h2>Fresh new layout</h2>
              <p>With Bootstrap 5, we've created a fresh new layout for this template!</p>
            </div>
          </div>
        </div>
        </div>
    )
  }
}
